import React from "react"
import { Row, Col } from "react-bootstrap"

const CollectionOne = () => {
  const items = [];

  for (let i = 1; i <= 4; i++) {
    let data = {};
    data.class = "collection-one-content";
    data.image = `CollectionOne_${i}`;

    items.push(data);
  }

  return (
    <Row className="row-section collection-section collection-one-section">
      <Col as="a" className="collection-one-content" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_1.jpg"}}></Col>
      <Col as="a" className="collection-one-content" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_2.jpg"}}></Col>
      <Col as="a" className="collection-one-content" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_3.jpg"}}></Col>
      <Col as="a" className="collection-one-content" style={{"backgroundImage": "/image/CollectionOne/CollectionOne_4.jpg"}}></Col>
    </Row>
  )
}

export default CollectionOne
